<0ff60a7ea47714b39c8cfb3fd2071b93>"a:2:{s:4:\"type\";s:25:\"PayplansAppEmailFormatter\";s:7:\"content\";a:3:{s:7:\"user_id\";s:4:\"6168\";s:7:\"subject\";s:29:\"Your Premium CPD Subscription\";s:4:\"body\";s:1093:\"<p>Dear Michael Alexander Lewis,<\/p>\r\n<p>Thank you for subscribing to our Premium CPD subscription plan. This gives you access to our extensive library of CPD courses. In addition to those available on-demand, remember that you will also be able to join in our <a href=\"my-learning\/live-webinars\">Evening Expert webinars<\/a>, during which you will be able to meet with other like-minded professionals.<\/p>\r\n<p>New content is added regularly, so look out for the notifications on the site, our social media pages and our newsletter.<\/p>\r\n<p>This is a recurring subscription that will automatically renew each month until cancelled. You may cancel at any time whilst it is active by logging into your PayPal account and cancelling the payment. Please note that it cannot be cancelled directly from our website.<\/p>\r\n<p>I very much hope that you find our CPD service of great benefit and look forward to meeting you on-line.<\/p>\r\n<p>Regards,<\/p>\r\n<p>Andrew<\/p>\r\n<hr \/>\r\n<p>Andrew Gould<br \/> Founder, <a href=\"https:\/\/www.dental-channel.co.uk\/\">The Dental Channel<\/a><br \/>+44 (0)20 8299 9742<\/p>\";}}"</0ff60a7ea47714b39c8cfb3fd2071b93>
<1970f1860b5642662026c32d86652ea9>"a:2:{s:4:\"type\";s:21:\"PayplansPlanFormatter\";s:7:\"content\";a:11:{s:7:\"plan_id\";s:2:\"44\";s:5:\"title\";s:12:\"Complete 365\";s:9:\"published\";s:1:\"0\";s:7:\"visible\";s:1:\"1\";s:8:\"ordering\";s:1:\"9\";s:11:\"checked_out\";s:1:\"0\";s:16:\"checked_out_time\";s:19:\"0000-00-00 00:00:00\";s:13:\"modified_date\";s:19:\"2022-01-16 12:19:00\";s:11:\"description\";s:982:\"<h5 class=\"uk-text-bold\">The whole caboodle!<\/h5>\r\n<p class=\"uk-text-small\">Our multi award-winning combination of quality-assured live and on-demand CPD:<\/p>\r\n<ul class=\"uk-list  uk-list-line uk-text-small\">\r\n<li>All our 'core', clinical and business management topics<br \/><br \/><a href=\"my-learning\/courses\">View course directory<\/a><\/li>\r\n<li><strong>Live webinars<\/strong>:\r\n<ul>\r\n<li>Monthly programme with acclaimed national and international presenters<\/li>\r\n<li>Meet with like-minded professionals from across the globe<\/li>\r\n<li>Catch-up service<\/li>\r\n<li>No travelling, no hassle<\/li>\r\n<\/ul>\r\n<\/li>\r\n<\/ul>\r\n<hr \/>\r\n<p class=\"uk-text-small\">Access any time from your desktop, laptop, tablet or phone<\/p>\r\n<hr \/>\r\n<p class=\"uk-text-small\">Track your learning and measure its impact on your patient care and career development<\/p>\r\n<hr \/>\r\n<p class=\"uk-text-primary uk-text-small\">Renews automatically each year until cancelled<br \/>(Protects against future price rises)<\/p>\";s:7:\"details\";s:221:\"{\"expirationtype\":\"recurring\",\"expiration\":\"010000000000\",\"recurrence_count\":\"0\",\"price\":\"249.99\",\"trial_price_1\":\"0.00\",\"trial_time_1\":\"000000000000\",\"trial_price_2\":\"0.00\",\"trial_time_2\":\"000000000000\",\"currency\":\"GBP\"}\";s:6:\"params\";s:568:\"{\"teasertext\":\"The best of both live and on-demand training\",\"redirecturl\":\"index.php?option=com_tjdashboard&view=dashboard&id=2&Itemid=768\",\"badgeVisible\":\"1\",\"badgePosition\":\"right\",\"badgeTitle\":\"Premium\",\"badgeTitleColor\":\"#2a52d4\",\"badgebackgroundcolor\":\"#eeeeee\",\"planHighlighter\":\"0\",\"limit_count\":\"\",\"scheduled\":\"\",\"start_date\":\"2021-08-21\",\"end_date\":\"2021-08-21\",\"total_count\":60,\"moderate_subscription\":\"\",\"parentplans\":\"\",\"displaychildplanon\":\"-2\",\"expiration_date\":\"2021-08-21\",\"subscription_from\":\"\",\"subscription_to\":\"\",\"enable_fixed_expiration_date\":\"\"}\";}}"</1970f1860b5642662026c32d86652ea9>
